import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Swal from "sweetalert2";

const UserCreate = () => {
    const [name, setName] = useState('')
    const [email, setEmail] = useState('')
    const [phone, setPhone] = useState('')
    const [languages,setLanguages] = useState('')

    const navigate = useNavigate()

    const createUser = (e) => {
        e.preventDefault()
        const userData = { name, email, phone }

        fetch('http://localhost:8080/users', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json'
            },
            body: JSON.stringify(userData)
        }).then((result) => {
            return result.json()
        }).then((response) => {
            Swal.fire({
                title: 'User created successfully !',
                icon: 'success'
            });
            navigate('/')
        }).catch((err) => {
            console.log(err)
        })
    }

    const handleLanguage = (e) => {
        const { lang, checked } = e.target;
        const  value  = e.target.value;
        console.log(value)
        setLanguages({...languages,value:checked})
        
    }
    console.log(languages)
    return (
        <div>
            <div className="row">
                <div className="offset-lg-3 col-lg-6">
                    <div className="container">
                        <div className="card" >
                            <div className="card-body">
                                <h5>Add User</h5>
                                <form className="user-form" onSubmit={createUser}>
                                    <div className="mb-3">
                                        <label className="form-label">Name</label>
                                        <input type="text" className="form-control" required name="name" value={name} onChange={e => setName(e.target.value)} />
                                    </div>
                                    <div className="mb-3">
                                        <label className="form-label">Email</label>
                                        <input type="email" className="form-control" required name="email" value={email} onChange={e => setEmail(e.target.value)} />
                                    </div>
                                    <div className="mb-3">
                                        <label className="form-label">Phone</label>
                                        <input type="text" className="form-control" required name="phone" value={phone} onChange={e => setPhone(e.target.value)} />
                                        {phone && !(phone.match(/^[6-9]\d{9}$/)) ? <span className="text-danger">Enter valid phone number</span> : null}
                                    </div>

                                    <div className="mb-3">
                                        <label className="form-label">Programming languages known</label><br></br>
                                        <div className="form-check">
                                            <input className="form-check-input" type="checkbox" name="languages"  value="php" onChange={(e)=>{setLanguages({...languages,php:e.target.checked})}} />
                                                <label className="form-check-label">PHP</label>
                                        </div>
                                        <div className="form-check">
                                            <input className="form-check-input" type="checkbox" name="languages" value="react" onChange={(e)=>{setLanguages({...languages,react:e.target.checked})}} />
                                                <label className="form-check-label">React</label>
                                        </div>
                                        <div className="form-check">
                                            <input className="form-check-input" type="checkbox" name="languages" value="laravel" onChange={handleLanguage} />
                                                <label className="form-check-label">React</label>
                                        </div>
                                    </div>

                                    <button type="submit" className="btn btn-success">Submit</button>
                                    <Link to="/" className="btn btn-danger">Cancel</Link>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default UserCreate;
